import React, { useState } from 'react'
import './styles/style.css'

function App() {
  
  const [left, setLeft] = useState(95)

  const style = {
    left: `${left}%`
  }
  
  return (
    <div className="canvas">
        <div className="obstacle" style={style}></div>
    </div>
  )
}

export default App
